import React from 'react';

const MusicCard = ({ music, onClick }) => {
    return (
        <div className="music-card" onClick={onClick}>
            <img src={music.cover} alt={music.title} />
            <div className="music-info">
                <h4>{music.title}</h4>
                <p>{music.artist}</p>
            </div>
        </div>
    );
};

export default MusicCard;
